import './App.css';
import ImageDetection from './components/ImageDetection.js';
import RealDetection from './components/RealDetection.js';

function App() {
  return (
    <div className="App mt-5 d-flex flex-sm-row flex-column justify-content-around">
      <div className="RealDetection d-flex flex-column align-items-center mb-5 mb-sm-0">
        <RealDetection />
      </div>
      <div className="ImageDetection d-flex flex-column align-items-center">
        <ImageDetection />
      </div>
    </div>
  );
}

export default App;
